import "./styles/style.css";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import SignIn from "./components/signin/SignIn";
import SpecificBook from "./components/specific-book/SpecificBook";
import EmptyCart from "./components/emptyCart/EmptyCart";
import PurchaseList from "./components/purchaseDesired/PurchaseList";
import Layout from "./components/layout/Layout";
import CardList from "./components/cards/CardList";

function App() {
  return (
    <div className="App">

     {/**/}


        <Routes>

        <Route path="/" element={<Layout />} >
          <Route path="signin" element={<SignIn />} />
          <Route path="book-list" element={<CardList />} />
          <Route path="specific-book" element={<SpecificBook />} />
          <Route path="empty-cart" element={<EmptyCart />} />
          <Route path="cart" element={<PurchaseList />} />
        </Route>

        </Routes>


    </div>
  );
}

export default App;
